import React from 'react';

import './Footer.css';

function Footer () {

	// var altoPantalla = screen.height;

	// document.body.clientHeight              /* Height of <body> */
	// document.documentElement.clientHeight   /* Height of <html> */
	// window.innerHeight     

	let alto = {
		"html" : document.body.clientHeight ,
		"ventana" : document.documentElement.clientHeight ,
	}
	
	if ( alto.html <= alto.ventana ) {
		console.log( `HTML es menor que VENTANA` );
	} else {
		console.log( `HTML es mayor que VENTANA` );
	};

	return (
		<footer>
			<p>Derechos no reservados</p>
		</footer>
	);
};

export default Footer;
